import './App.css';
import Header from './Components/Header'
import Todos from './Components/Todos';
import {Footer} from './Components/Footer';

function App() {
  todos = [
    {
      sno: 1,
      title: "Let's Play",
      desc: "Play outdoor games"
    },
    {
      sno: 2,
      title: "Let's Eat",
      desc: "Go to Restaurant"
    }
  ]
  return (
    <>
      <Header title="My ToDos List" searchBar={false}/>
      <Todos todos={todos}/>
      <Footer/>
    </>
  );
}

export default App;
